import ReactDOM from 'react-dom';
import './Navbar.scss';
import logo from './grc-logo.svg';
import $ from 'jquery';
import { Link } from 'react-router-dom';
import React, { Component } from 'react'

export default class GrcNavbar extends Component {
  componentDidMount () {
    $('.hamburger1').on('click', function() {
      $('.rectangle').addClass('show-bottom');
      $('.bottom').removeClass('shrink').addClass('expand');
      $('article').addClass('expand-body');
      setTimeout(function() {
        $('ul').fadeIn();}, 500);
    });

    $('.hamburger2').on('click', function() {
      $('ul').fadeOut();
      $('.bottom').removeClass('expand').addClass('shrink');
      $('article').removeClass('expand-body');
      setTimeout(function() {
        $('.rectangle').removeClass('show-bottom');}, 550);
    });
  }
  render() {
    return (
      <div>
        <div className="scene">
          <div className="rectangle">
            <nav className="cube-face front">
              <h1><img src={logo} alt="grc"/></h1>
              <svg className="hamburger1" viewBox="0 0 51 33" xmlns="http://www.w3.org/2000/svg"><title> Group</title><desc> Created with Sketch.</desc><g fill="none"><g fill="#fff"><rect width={50} height="1.7" /><rect y={15} width={50} height="1.7" /><rect y="31.1" width={50} height="1.7" /></g></g></svg>
            </nav>
            <nav className="cube-face bottom">
              <svg className="hamburger2" width="37px" height="37px" viewBox="0 0 37 37" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
                {/* Generator: Sketch 49.2 (51160) - http://www.bohemiancoding.com/sketch */}
                <desc>Created with Sketch.</desc>
                <defs />
                <g id="Welcome" stroke="none" strokeWidth={1} fill="#111" fillRule="evenodd">
                  <g id="Tablet-Portrait" transform="translate(-672.000000, -16.000000)" fill="#111">
                    <g id="Group" transform="translate(671.789062, 15.596375)">
                      <rect id="Rectangle-3" transform="translate(19.000000, 18.833333) rotate(45.000000) translate(-19.000000, -18.833333) " x={-6} y={18} width={50} height="1.66666667" />
                      <rect id="Rectangle-3" transform="translate(19.000000, 18.833333) rotate(-45.000000) translate(-19.000000, -18.833333) " x={-6} y={18} width={50} height="1.66666667" />
                    </g>
                  </g>
                </g>
              </svg>
              <h1>Menu</h1>
              <ul>
                <li>About</li>
                <li>Portfolio</li>
                <li>Journal</li>
                <li>Contact</li>
              </ul>
            </nav>
          </div>
        </div>
        <article></article>
      </div>
    )
  }
}
